import React from 'react';
import { Sun, Home } from 'lucide-react';
import { renderToString } from 'react-dom/server';

// This component is used to generate the HTML for the label
const LabelContent = ({ product }) => {
    const isOutdoor = product.category.toLowerCase().includes('outdoor');
    const isIndoor = product.category.toLowerCase().includes('indoor');

    // Inline styles are used for precise control in the print window
    return (
        <div style={{
            width: '50mm', height: '25mm', boxSizing: 'border-box',
            backgroundColor: 'white', color: 'black',
            fontFamily: 'sans-serif',
            display: 'flex', flexDirection: 'column',
            justifyContent: 'space-between', padding: '2mm'
        }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%' }}>
                <div style={{ textAlign: 'left' }}>
                    <h3 style={{ fontSize: '7px', fontWeight: 'bold', margin: 0 }}>Vrindavan Garden</h3>
                    <p style={{ fontSize: '6px', margin: 0 }}>Hadapsar, Ph: 9767126970</p>
                </div>
                <div style={{ display: 'flex', alignItems: 'center' }}>
                    {isIndoor && <Home size={12} />}
                    {isOutdoor && <Sun size={12} />}
                </div>
            </div>
            <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', width: '100%' }}>
                <div style={{ textAlign: 'left' }}>
                    <h4 style={{ fontSize: '11px', fontWeight: 'bold', textTransform: 'uppercase', margin: 0 }}>{product.name}</h4>
                </div>
                <div style={{ textAlign: 'right' }}>
                    <p style={{ fontSize: '16px', fontWeight: '800', margin: 0 }}>â‚¹{product.price}</p>
                </div>
            </div>
            <div style={{ width: '100%', textAlign: 'center' }}>
                <p style={{ fontSize: '7px', color: '#555', margin: '0 0 1mm 0' }}>{product.description}</p>
                <img id="barcode" alt="barcode"/>
            </div>
        </div>
    );
};

const PriceLabel = ({ product }) => {
    if (!product) return null;

    const handlePrint = () => {
        // 1. Render the LabelContent component to an HTML string
        const labelComponentHtml = renderToString(<LabelContent product={product} />);
        
        // 2. Create the full HTML for the new window
        const printHtml = `
            <html>
                <head>
                    <title>Print Label - ${product.name}</title>
                    <style>
                        body { margin: 0; }
                    </style>
                </head>
                <body>
                    ${labelComponentHtml}
                    <script src="[https://cdn.jsdelivr.net/npm/jsbarcode@3.11.5/dist/JsBarcode.all.min.js](https://cdn.jsdelivr.net/npm/jsbarcode@3.11.5/dist/JsBarcode.all.min.js)"></script>
                    <script>
                        // Generate the barcode
                        JsBarcode("#barcode", "${product.sku}", {
                            format: "CODE128",
                            width: 1.5,
                            height: 25,
                            displayValue: false,
                            margin: 0
                        });
                        // Trigger the print dialog
                        window.print();
                        // Optional: close the window after printing
                        window.onafterprint = window.close;
                    </script>
                </body>
            </html>
        `;

        // 3. Open a new window and write the HTML to it
        const printWindow = window.open('', '_blank', 'width=300,height=200');
        printWindow.document.write(printHtml);
        printWindow.document.close();
    };

    return (
        <div>
            {/* Visual preview for the modal */}
            <div className="border-2 border-dashed border-gray-400">
                 <LabelContent product={product} />
            </div>

            {/* Print button */}
            <div className="flex justify-center mt-6">
                 <button onClick={handlePrint} className="py-2 px-5 bg-green-600 text-white rounded-lg hover:bg-green-500 transition-colors">Print Label</button>
            </div>
        </div>
    );
};

export default PriceLabel;
